import React from 'react';
import ListItem from './ListItem.js';

class List extends React.Component {    
    prueba() {
        console.log('a')
    }
    render() {
        return (
            <ul>
                {this.props.todos.map(todo =>
                    <ListItem key={todo.id.toString()} onPress={this.prueba} task={todo}></ListItem>
                )}
            </ul>
        )

    }
}

export default List;
